import React from 'react'
import {Link} from 'react-router-dom'

function Navbar() {
  return (
    <div className='navbar'>
        <Link to='#' className='menu-bar'>
        <i class="fas fa-bars"></i>

        </Link>
    </div>
  )
}

export default Navbar
